import React, { useEffect, useState } from 'react';

function NavbarNotifyComp(props) {
    const [notifyList, setNotifyList] = useState([])
    let temp = []

    useEffect(() => {
        for(let i = 0; i < 5; i++){
            temp.push(
                <div className = 'card-body' key = { i }>
                    <h3 className = 'card-title'>2330</h3>
                    <h6 className = "card-subtitle text-muted">穿越地板線</h6>
                </div>
            )

            if(i == 4){
                setNotifyList(temp)
            }
        };
    }, [])

    return (
        <>
            <div className = " container" style = {{ width : "200px" }}>
                <div className = 'row'>
                    <div className = 'col text-center' style = {{ cursor : "pointer" , borderRight: "1px solid #ADADAD"}}>
                        未讀
                    </div>

                    <div className = 'col text-center' style = {{ cursor : "pointer" }}>
                        已讀
                    </div>
                </div>

                <hr />

                <div className = 'row' id = "NotifyList">
                    {notifyList}
                </div>
            </div>
        </>
    );
}

export default NavbarNotifyComp;
